import React from "react";

const Languages = () => {
  return (
    <div id="languages" className="languages">
      <h1 className="title">LANGUAGES</h1>

      <p>Languages that I speak:</p>
      <div className="lang">
        <div className="ll"> ARABIC:</div>
        <div className="mm"> fluent</div>
      </div>
      <div className="lang">
        <div className="ll"> ENGLISH:</div>
        <div className="mm"> very good</div>
      </div>
      <div className="lang">
        <div className="ll"> FRENSH:</div>
        <div className="mm"> good</div>
      </div>
    </div>
  );
};

export default Languages;
